function onSendInvite(){
    var tempJson = newjson;
    var meProfile = tempJson.profile.me;
    var yoProfile = tempJson.profile.yo;
    
    tempJson.type = "invite";
    tempJson.state = "start";
    tempJson.mid = tempJson.mid + 1;
    tempJson.turn = yoProfile.uid;
    tempJson.profile.me = yoProfile;
    tempJson.profile.yo = meProfile;
    
    native.postMessage(tempJson);
}

