function onReceiveMessage(json){
//    alert("onReceiveMessage");
    var parsedData = JSON.parse(json);
//    alert(parsedData.type);
    document.querySelector("#message_name").innerText = parsedData.game + "----status:" + parsedData.type;
    document.querySelector("#message_me_uid").innerText = parsedData.profile.me.name;
    document.querySelector("#message_yo_uid").innerText = parsedData.profile.yo.name;
    newjson = parsedData;
}




